<script>
    async function Like(idPost) {
    var parametros = {
        IdPost: idPost
    };

    $.ajax({
        datatype: 'json',
        contentType: ""application/json"",
        type: ""POST"",
        url: ""/Publicacoes/Like"",
        data: JSON.stringify(parametros),
        async: true,
        success: function (data) {
            document.location.reload();
        }
    });
}

$('body').on('submit', '#formComentario', function (evt) {
    evt.preventDefault();
    $.ajax({
        url: '/Post/Comentario',
        type: 'post',
        data: $('#formComentario').serialize(),
        success: function () {
            document.location.reload();
        }
    });
});

$(""#comentar"").click(function () {
    $(""#formComentario"").show();
});
</script>
